// O(NlogN) Time and (N) Space --> Merge Sort Algorithm
class Solution {
public:
    bool isIdealPermutation(vector<int>& nums) {
        int curr_max = -1;
        for(int i = 0; i < nums.size()-2; i++){
            curr_max = max(curr_max, nums[i]);
            if(curr_max > nums[i+2]) return false;
        }
        return true;
    }
};

